This sign hangs horizontally and reads &quot;Be Kind. Live, Laugh, Love&quot;.  It was hand painted by my sister-in-law with acrylic paint on a piece of repurposed scrap wood and has a piece of twine attached to the back to make hanging easier.  This sign will make an awesome house warming gift for a friend or wonderful classroom décor for a new teacher.

Size - 20&quot; by 5&quot;

Happy shopping!
